import React from 'react'
import CenterView from 'react-bootstrap/Container'
import { Document, Page } from 'react-pdf/dist/esm/entry.webpack'

class Resume extends React.Component{

    docDisplayFailure = () => {
        alert("Error loading resume. Please try again later.")
    }

    render(){
        return (
            <CenterView className='page-content'>
                <div name="Resume">
                    <Document file="../resources/Ben_Lottes_Resume.pdf" onLoadFailure={docDisplayFailure}>
                        <Page pageNumber={1} />
                    </Document>
                </div>
            </CenterView>
        )
    }
}

export default Resume
